import { Button, Search } from "src/commonStyles";
import { Container, Wrap } from "./styled";

export default function Header() {
  return (
    <Wrap>
      <Container>
        <span style={{wid}}>Logo</span>
        <Search placeholder="Найти" />
        <span>Добавить объект</span>
        <Button $width="258px">Личный кабинет</Button>
      </Container>
    </Wrap>
  );
}
